import React from 'react';

function ResponseList({ responses }) {
  return (
    <div className="ResponseList">
      <h2>Respostas</h2>
      <ul>
        {responses.map((response, index) => (
          <li key={index}>
            {response.name} - {response.age} anos - {response.gender}
          </li>
        ))}
      </ul>
    </div>
  );
}

export default ResponseList;
